    false,nt"url": null,nt"notes": "Rugosity is derived from gridded (10 m
    cell size) multibeam bathymetry, collected aboard NOAA Ship Hi'ialakai and R/V AHI,
    using the Benthic Terrain Modeler with rugosity methods by Jeff Jenness (2003).
    Cell values reflect the surface area to planimetric area ratio for the area contained
    within that cell's neighborhood. They provide indices of topographic roughness &
    convolutedness. This data set is for the shelf and slope environment of Sarigan
    Island.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
